import React from "react";
import "./PickList.css";

const Pick = ({ name }) => {
  return (
    <div className="element">
      <p>{name}</p>
      <div className="delete">x</div>
    </div>
  );
};

const PickList = ({ name, list }) => {
  return (
    <tr>
      <td></td>
      <td className={name}>
        {list === -1 ? "" : list.map((item) => <Pick name={item} />)}
      </td>
    </tr>
  );
};

export { Pick, PickList };
